package main

import (
	"encoding/base64"
	"io/ioutil"
)

func decodeBase64Audio(base64Audio string) error {
	// 解码base64字符串
	data, err := base64.StdEncoding.DecodeString(base64Audio)
	if err != nil {
		return err
	}

	// 将解码后的数据写入文件
	err = ioutil.WriteFile("output.mp3", data, 0644)
	if err != nil {
		return err
	}

	return nil
}

func main() {
	audio := ``
	decodeBase64Audio(audio)
}
